import React from 'react';
import Creators from '../Creators';
import OutputFilters from '../OutputFilter';
import style from '../../style.module.scss';

export default function OutPutContainer({
	creators,
	exactCreators,
	videos,
	getMoreCreators,
	clickedShowMore,
	loading,
	stopShowMore,
}) {
	return (
		<div className={style.outputContainer}>
			{exactCreators.length ? (
				<>
					<h3>Featured creators</h3>
					<Creators
						creators={exactCreators}
						videos={videos}
						getMoreCreators={getMoreCreators}
						showMore={false}
						clickedShowMore={clickedShowMore}
					/>
				</>
			) : null}
			{creators.length ? (
				<>
					<h3>All Creators</h3>
					<Creators
						creators={creators}
						videos={videos}
						getMoreCreators={getMoreCreators}
						clickedShowMore={clickedShowMore}
						loading={loading}
						showMore={true}
						stopShowMore={stopShowMore}
					/>
				</>
			) : null}
		</div>
	);
}
